<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Mike Bishop | Motor City Auto Brokers</title>
    <link href="https://fonts.googleapis.com/css2?family=Inter:wght@400;600;700&display=swap" rel="stylesheet">
    <style>
        :root {
            --gold: #d4af37;
            --dark-bg: #0a0f1a;
            --card-bg: #111827;
            --text-gray: #94a3b8;
            --accent: #c49b1c;
        }

        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            font-family: 'Inter', sans-serif;
            background-color: var(--dark-bg);
            color: #ffffff;
            display: flex;
            justify-content: center;
            min-height: 100vh;
        }

        .dbc-wrapper {
            width: 100%;
            max-width: 500px;
            background: var(--card-bg);
            min-height: 100vh;
            display: flex;
            flex-direction: column;
            box-shadow: 0 0 50px rgba(0,0,0,0.5);
        }

        .hero-poster {
            position: relative;
            overflow: hidden;
        }

        .hero-poster img {
            width: 100%;
            height: auto;
            display: block;
        }

        .hero-overlay {
            position: absolute;
            bottom: 0;
            left: 0;
            right: 0;
            background: linear-gradient(transparent, rgba(17,24,39,0.95));
            padding: 30px 20px 20px;
        }

        .hero-overlay h1 {
            font-size: 28px;
            font-weight: 700;
            margin-bottom: 5px;
        }

        .hero-overlay p {
            color: var(--gold);
            font-size: 14px;
            font-weight: 600;
        }

        .action-layer {
            padding: 25px 20px 40px 20px;
            background: linear-gradient(to bottom, var(--card-bg), var(--dark-bg));
            flex-grow: 1;
        }

        .tagline {
            text-align: center;
            color: var(--text-gray);
            font-size: 14px;
            margin-bottom: 25px;
            line-height: 1.5;
        }

        .primary-actions {
            display: flex;
            flex-direction: column;
            gap: 12px;
            margin-bottom: 30px;
        }

        .btn {
            width: 100%;
            padding: 16px;
            border-radius: 12px;
            font-size: 15px;
            font-weight: 700;
            text-align: center;
            text-decoration: none;
            transition: all 0.3s ease;
            cursor: pointer;
            display: block;
            border: none;
            text-transform: uppercase;
            letter-spacing: 1px;
        }

        .btn-save {
            background: linear-gradient(135deg, #d4af37 0%, #b8860b 100%);
            color: #000;
            box-shadow: 0 4px 15px rgba(212, 175, 55, 0.3);
        }

        .btn-save:hover {
            transform: translateY(-2px);
            box-shadow: 0 6px 20px rgba(212, 175, 55, 0.5);
        }

        .btn-outline {
            background: transparent;
            color: var(--gold);
            border: 2px solid var(--gold);
        }

        .btn-outline:hover {
            background: rgba(212, 175, 55, 0.1);
        }

        .icon-grid {
            display: grid;
            grid-template-columns: repeat(4, 1fr);
            gap: 15px;
            border-top: 1px solid rgba(255,255,255,0.1);
            padding-top: 25px;
        }

        .icon-item {
            display: flex;
            flex-direction: column;
            align-items: center;
            gap: 8px;
            text-decoration: none;
            color: var(--text-gray);
            transition: color 0.3s ease;
        }

        .icon-item:hover {
            color: var(--gold);
        }

        .icon-circle {
            width: 50px;
            height: 50px;
            border-radius: 50%;
            background: rgba(255,255,255,0.05);
            display: flex;
            align-items: center;
            justify-content: center;
            font-size: 20px;
            border: 1px solid rgba(255,255,255,0.1);
        }

        .icon-label {
            font-size: 11px;
            font-weight: 600;
            text-transform: uppercase;
        }

        .footer-logo {
            text-align: center;
            margin-top: 35px;
            font-size: 12px;
            letter-spacing: 2px;
            color: var(--gold);
            opacity: 0.7;
        }
    </style>
</head>
